import VueRouter from "vue-router"
import Main from "@/components/Main.vue";
import Vue from "vue";
import Login from "@/components/Login.vue";

Vue.use(VueRouter)
const router = new VueRouter({
    routes:[
        {
            path:"/login",
            name:"login",
            component:Login,
            meta:{
                keepalive:false
            }
        },
        {
            path: "/",
            name:"main",
            component: Main,
            meta:{
                keepalive: true
            }
        },
        {
            path:"/charts",
            name:"charts",
            component:()=>import("@/components/Charts.vue"),
            meta:{
                keepalive: true
            }

        },
        {
            path:"/instruction",
            name:"instruction",
            component: ()=>import("@/components/Instruction.vue"),
            meta:{
                keepalive:true
            }
        }
    ]
})

router.beforeEach((to,from,next)=>{
    if(to.meta.keepalive){
        if(localStorage.getItem("login")==="admin"){
            next()
        }else{

        }
    }else{
        next()
    }
})

export default router
